import { FlowerChoosingBouquet } from "../FlowerChoosingBouquet";

export const FlowersRenderComponent = () => {
  const cartValue = 0;

  return (
    <>
      <FlowerNav cartvalue={numberOfItems} />
      <FlowerField />
      <FlowerIntro />
      <FlowerChoosingBouquet cartValue={cartValue} />
    </>
  );
};
